import React, { Component } from "react";
import ReactTypingEffect from "react-typing-effect";

const typingEffect = () => {
  return (
    <ReactTypingEffect text="Somewhere on earth, about 65.2 milion years ago..." />
  );
};

function textIntro() {
  setTimeout(() => {
    typingEffect();
  }, 2000);
}

// function lol() {
//   setTimeout(() => {
//     console.log("Hello, World!");
//   }, 3000);
// }

export default class IntroText extends Component {
  render() {
    return (
      <div className="intro">
        <div className="textIntro">{textIntro()}</div>
      </div>
    );
  }
}
